import React, {Component} from 'react';
import Background from '../photos/contactus.jpg'

var sectionStyle = {
    width: "100%",
    height: "400px",
    backgroundImage: `url(${Background})`
  };

class Contactus extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
             <section style={ sectionStyle }>

            </section>
        )
    }
}

export default Contactus
